function toggleSwitch(t){t.addEventListener("click",function(){this.classList.contains("active")?this.classList.remove("active"):this.classList.add("active")})}for(var navIcon=document.querySelectorAll(".nav-icon"),i=0;i<navIcon.length;i++){var toggle=navIcon[i];toggleSwitch(toggle)}